import React from 'react';
import FastingTimer from './FastingTimer';

export default function WorkoutLibrary() {
  return (
    <div className="min-h-screen bg-gray-50">
      <div className="max-w-2xl mx-auto pt-8">
        <FastingTimer />
      </div>
    </div>
  );
}
